import React from 'react';

function App() {
  return (
    <div>
      <nav>
        <h1>Moje ime je Dejan.</h1>
        <p>Ja sam veoma brz.</p>
        <ul>
          <li>Rukomet</li>
          <li>Fudbal</li>
          <li>Kosarka</li>
        </ul>
      </nav>
      <main>
        <p>Ovde ce biti sadrzaj stranice.</p>
      </main>
    </div>
  );
}

export default App;
